"____EXAMPLE____013": "=begin comment\n<!-- language=\"C\" -->\n  GVariant *\n  add_to_count (GVariant  *orig,\n                GError   **error)\n  {\n    GVariantDict dict;\n    guint32 count;\n\n    g_variant_dict_init (&dict, orig);\n    if (!g_variant_dict_lookup (&dict, \"count\", \"u\", &count))\n      {\n        g_set_error (...);\n        g_variant_dict_clear (&dict);\n        return NULL;\n      }\n\n    g_variant_dict_insert (&dict, \"count\", \"u\", count + 1);\n\n    return g_variant_dict_end (&dict);\n  }\n\n=end comment\n"
"____EXAMPLE____014": "=begin comment\n<!-- language=\"C\" -->\n  GVariant *\n  add_to_count (GVariant  *orig,\n                GError   **error)\n  {\n    GVariantDict *dict;\n    GVariant *result;\n    guint32 count;\n\n    dict = g_variant_dict_new (orig);\n\n    if (g_variant_dict_lookup (dict, \"count\", \"u\", &count))\n      {\n        g_variant_dict_insert (dict, \"count\", \"u\", count + 1);\n        result = g_variant_dict_end (dict);\n      }\n    else\n      {\n        g_set_error (...);\n        result = NULL;\n      }\n\n    g_variant_dict_unref (dict);\n\n    return result;\n  }\n\n=end comment\n"
